var cordovaDeviceModule=angular.module("cordovaDeviceModule",[]);cordovaDeviceModule.constant("cordovaDeviceConstants",{apiVersion:"1.0.0",unavailable:"N/A"});cordovaDeviceModule.factory("cordovaDeviceService",["$log","cordovaDeviceConstants",function(e,t){return{apiVersion:function(){e.debug("cordovaDeviceService.apiVersion.");return t.apiVersion},cordova:function(){e.debug("cordovaDeviceService.cordova.");return this.getDeviceValue("cordova")},platform:function(){e.debug("cordovaDeviceService.platform.");return this.getDeviceValue("platform")},uuid:function(){e.debug("cordovaDeviceService.uuid.");return this.getDeviceValue("uuid")},version:function(){e.debug("cordovaDeviceService.version.");return this.getDeviceValue("version")},model:function(){e.debug("cordovaDeviceService.model.");return this.getDeviceValue("model")},getDeviceValue:function(n){e.debug("cordovaDeviceService.value.");if(!window.device){return t.unavailable}return window.device[n]}}}]);cordovaDeviceModule.controller("CordovaDeviceCtrl",["$scope","cordovaDeviceService",function(e,t){e.deviceService=t}])